import axios from "axios"
export const getCart=async()=>{
    try{
        const response=await axios.get("/api/user/cart",{
            headers:{authorization:localStorage.getItem("token")}
        });
        console.log(response)
      } 
      catch(e){
        console.log(e);
      }
     
}
